import React from 'react';
import Sidebar from '../../components/Sidebar';
import WelcomeHeader from '../../components/WelcomeHeader';
import '../Dashboard/Dashboard.css';
import WhiteRectangle from '../../components/WhiteRectangle';

const Product = () => {
  return (
    <div className="dashboard-container">
      <Sidebar />
      <div className="dashboard-main">
        <div className="product-header">
          <div className="dashboard-welcome-container">
            <WelcomeHeader />
          </div>
          <div className="header-right">
            <button className="add-item-button">Add item +</button>
          </div>
        </div>
        <div className="rectangle-and-button-container">
          <WhiteRectangle>
            <div className="order-labels-row">
              <div className="order-label">No.</div>
              <div className="order-label">Product Name</div>
              <div className="order-label">Bar code</div>
              <div className="order-label">Price</div>
              <div className="order-label">Stock</div>
              <div className="order-label">Action</div>
            </div>
            <div className="order-separator"></div>
          </WhiteRectangle>
        </div>
      </div>
    </div>
  );
};

export default Product;
